import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import './NavBar.css';
import 'tailwindcss/tailwind.css';

import logo from '../logo.png';


class NavBar extends Component {

	render(){

		return (
			<div>
				

				<img src={logo} id='navbar-logo' className="App-logo ml-2 w-80" alt="logo" />
				
				<div className='navbar-links '>
					
					<Link to="/">  <a> Diskify </a> </Link> 
					<Link to="/me"> <a> Me </a> </Link>
					<Link to="/mint"> <a> Mint </a> </Link>
					<Link to="/search"> <a> Search NFTs </a> </Link>

				</div>

			</div>

		);

	}
}

export default NavBar;

